	function ListFiles($dir, $save) {
		$result = "";
		if($dh = opendir($dir)) {
			$files = Array();
			$inner_files = Array();		
			while($file = readdir($dh)) {
				if($file != "." && $file != ".." && $file[0] != '.') {
					$dir = (substr($dir, -1) == '/') ? $dir : $dir . "/";
					if(is_dir($dir . "/" . $file)) {						
						$inner_files = ListFiles($dir . $file);
						if(is_array($inner_files)){
							$files = array_merge($files, $inner_files);
						}
					} else {					
						array_push($files, $dir . $file);
					}
				}
			}
			closedir($dh);
			return $files;
		}
	}
	
